import React from 'react';
import styled from 'styled-components';

const LeftNav = styled.div`
    ul {
    background-color: #fff;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    }
`;

const HeaderNav = () => {
    return (
        <Nav>
            <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">Promotion</a></li>
                <li><a href="#">Menu</a></li>
                <li><a href="#">Cart</a></li>
            </ul>
        </Nav>
    )
}

export default HeaderNav;
